import { Box } from '@mui/material';
import React from 'react';
import './VideoPlayer.scss';

const VideoPlayer = () => {
    return (
        <Box id='video-player'>
            <Box className="video-container"></Box>
        </Box>
    );
};

export default VideoPlayer;
